			Var.AccuReadyToFill = 0;
		}

		if (Orders(Accumulator).IngSrc.2033Feeder.Exists = True and System.2033Feeder.Mode <> ReadyForDischarge) {
			Var.AccuReadyToFill = 0;
		}

		if (Orders(Accumulator).IngSrc.3013Feeder.Exists = True and System.3013Feeder.Mode <> ReadyForDischarge) {
			Var.AccuReadyToFill = 0;
		}

		if (Orders(Accumulator).IngSrc.3033Feeder.Exists = True and System.3033Feeder.Mode <> ReadyForDischarge) {
			Var.AccuReadyToFill = 0;
		}

		if (Orders(Accumulator).IngSrc.1123Feeder.Exists = True and System.1123Feeder.Mode <> ReadyForDischarge) {
			Var.AccuReadyToFill = 0;
		}

		if (Var.AccuReadyToFill = 1){
			System.Accumulator.Mode = Filling;
		}
	}

} else {
	Var.AccuDoorPos = 0;
	System.AccuDoor.Mode = Moving;
}

if (Orders(Accumulator).Exists = True) {
	Var.SequenceDone = 1;

	if (Orders(Accumulator).IngSrc.2013Feeder.Exists = True and Orders(Accumulator).IngSrc.2013Feeder.Done = False and Var.AccuSequenceNum = Var.2013SequenceNum) {
		Var.SequenceDone = 0;
	}

	if (Orders(Accumulator).IngSrc.2033Feeder.Exists = True and Orders(Accumulator).IngSrc.2033Feeder.Done = False and Var.AccuSequenceNum = Var.2033SequenceNum) {
		Var.SequenceDone = 0;
	}

	if (Orders(Accumulator).IngSrc.3013Feeder.Exists = True and Orders(Accumulator).IngSrc.3013Feeder.Done = False and Var.AccuSequenceNum = Var.3013SequenceNum) {
		Var.SequenceDone = 0;
	}

	if (Orders(Accumulator).IngSrc.3033Feeder.Exists = True and Orders(Accumulator).IngSrc.3033Feeder.Done = False and Var.AccuSequenceNum = Var.3033SequenceNum) {
		Var.SequenceDone = 0;
	}

	if (Orders(Accumulator).IngSrc.1123Feeder.Exists = True and Orders(Accumulator).IngSrc.1123Feeder.Done = False and Var.AccuSequenceNum = Var.1123SequenceNum) {
		Var.SequenceDone = 0;
	}

	if (Var.SequenceDone = 1) {
		Var.AccuSequenceNum = Var.AccuSequenceNum + 1;
	}

	if (Var.AccuSequenceNum > 10) {
		System.Accumulator.Mode = BeltCleanout;
	}

