function.code:
if (l.do = On and l.di = On) {
	Form.form1.Button.l.btn.BackColor = 255, 0, 255, 0;
} elseif (l.do = On and l.di = Off) {
	Form.form1.Button.l.btn.BackColor = 255, 255, 255, 0;
} elseif (l.do = Off and l.di = On) {
	Form.form1.Button.l.btn.BackColor = 255, 255, 175, 0;
} else  {
	Form.form1.Button.l.btn.BackColor = 255, 255, 0, 0;
}

if (l.do = On) {
	l.do = Off;
} else {
	l.do = On;
}

if (lvar.FeederPaused = 1) {
	lsys.Feeder.Mode = Paused;
} else {

	if (Orders(lo.FeederName).Exists = True) {
		if (Orders(lo.FeederName).IngSrc.lo.FeederName.Done = False) {
			if (Orders(lo.FeederName).IngSrc.lo.FeederName.Exists = True) {
				lvar.SequenceNum = Orders(lo.FeederName).IngSrc.lo.FeederName.Sequence;
				lvar.StartWeight = PLCScale.lo.FeederName - lvar.OverfillAmt;

				if (lvar.StartWeight > Orders(lo.FeederName).IngSrc.lo.FeederName.TargetWeight) {
					lsys.Feeder.Mode = ReadyForDischarge;
				} else {
					lvar.FeederPaused = 1;
				}	

			} else {
				Orders(lo.FeederName).IngSrc.lo.FeederName.Done = True;
				lsys.Feeder.NextOrder();
			}
		}
	}
}

if (lvar.FeederPaused = 1) {
	lsys.Feeder.Mode = Paused;
} else {

	if (System.Accumulator.Mode = Filling and lsys.Feeder.OrderNum = System.Accumulator.OrderNum and lvar.SequenceNum = Var.AccuSequenceNum) {
		lvar.StartWeight = PLCScale.lo.FeederName;
		lvar.TargetWeight = PLCScale.lo.FeederName - Orders(lo.FeederName).IngSrc.lo.FeederName.TargetWeight + Orders(lo.FeederName).IngSrc.lo.FeederName.Preact;
		lsp.Target.Set(lvar.TargetWeight);
		lsp.ToSlow.Set(lvar.TargetWeight + Orders(lo.FeederName).IngSrc.lo.FeederName.ToSlowWeight);
		lsys.Feeder.Mode = MeteringAugers;
	}

}

lvar.Clean = 0;

if (System.4011Conveyor.Mode = Running) {
	ldo.Auger1 = On;
	ldo.Auger2 = On;
	ldo.Auger3 = On;
} else {
	ldo.Auger1 = Off;
	ldo.Auger2 = Off;
	ldo.Auger3 = Off;
}

if (ldi.Auger1 = On and ldi.Auger2 = On and ldi.Auger3 = On) {
	ltmr.MeterTimer.Start(Var.MeterAugerDelay);
} else {
	ltmr.MeterTimer.Stop();
}

if (System.4011Conveyor.Mode = Running) {

	if (ldi.Auger1 = On and ldi.Auger2 = On and ldi.Auger3 = On) {
		ldo.Auger4 = On;
	} else {
		ldo.Auger4 = Off;
		lsys.Feeder.Mode = MeteringAugers;
	}

} else {
	ldo.Auger1 = Off;
	ldo.Auger2 = Off;
	ldo.Auger3 = Off;
	ldo.Auger4 = Off;
	lsys.Feeder.Mode = MeteringAugers;
}

if (System.4011Conveyor.Mode = Running) {
	ldo.Auger4 = On;
	ldo.Auger1 = Off;
	ldo.Auger2 = On;
	ldo.Auger3 = Off;
} else {
	ldo.Auger4 = Off;
	ldo.Auger1 = Off;
	ldo.Auger2 = Off;
	ldo.Auger3 = Off;
}

ldo.Auger4 = Off;
ldo.Auger1 = Off;
ldo.Auger2 = Off;
ldo.Auger3 = Off;

if (PLCScale.lo.FeederName.Stable = True) {
	lsys.Feeder.Mode = Finished;
}

Orders(lo.FeederName).IngSrc.lo.FeederName.ActualWeight = lvar.StartWeight - PLCScale.lo.FeederName;
Orders(lo.FeederName).IngSrc.lo.FeederName.Done = True;
lsys.Feeder.NextOrder();
ltmr.Cleanout.Start(lvar.CleanoutTime);
lsys.Feeder.Mode = WaitingForOrder;

if (lvar.GatePos = 1) {

	if (ldi.LOGateOpen = Off) {
		lsys.LOGate.Mode = Moving;
	}

} else {

	lsys.LOGate.Mode = Moving;

}

