	ldo.LOGateClose = Off;

	if (ldi.LOGateOpen = On) {
		ldo.LOGateOpen.OffDelay(Var.LOGateDelayTime);
		lsys.LOGate.Mode = Open;
	}

} else {

	ldo.LOGateOpen = Off;
	ldo.LOGateClose = On;

	if (ldi.LOGateClose = On) {
